"use strict";(self.webpackChunkwayop_docs=self.webpackChunkwayop_docs||[]).push([[53],{1109:function(e){e.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"defaultSidebar":[{"type":"link","label":"Install Wayop","href":"/docs/intro","docId":"intro"},{"type":"link","label":"Bookings","href":"/docs/bookings","docId":"bookings"},{"type":"link","label":"Tours","href":"/docs/tours","docId":"tours"},{"type":"link","label":"Resources","href":"/docs/resources","docId":"resources"},{"type":"link","label":"Invoicing","href":"/docs/invoicing","docId":"invoicing"},{"type":"link","label":"Settings","href":"/docs/settings","docId":"settings"},{"type":"link","label":"Users","href":"/docs/users","docId":"users"}]},"docs":{"bookings":{"id":"bookings","title":"Bookings","description":"The bookings tab allows you to see your sales feed coming from B\xf3kun. The feed is updated automatically every time a new booking is created or modified in B\xf3kun. Wayop connects to B\xf3kun using APIs and webhooks to always ensure that the data you see is up to date. Bookings are sorted in chronological order, the most recent ones always appearing at the top of the list!","sidebar":"defaultSidebar"},"intro":{"id":"intro","title":"Install Wayop","description":"Getting Started","sidebar":"defaultSidebar"},"invoicing":{"id":"invoicing","title":"Invoicing","description":"The invoicing page allows you to track the status of your invoices. You can see the total price charged to your customers for each booking and follow up with them to resolve any unpaid bills. The invoicing view is updated automatically every time a new booking is created or modified in B\xf3kun. Wayop connects to B\xf3kun using APIs and webhooks to always ensure that the data you see is up to date. Bookings are sorted in chronological order, the most recent ones always appearing at the top of the list!","sidebar":"defaultSidebar"},"resources":{"id":"resources","title":"Resources","description":"resources}","sidebar":"defaultSidebar"},"settings":{"id":"settings","title":"Settings","description":"The settings page is where you can define (and customise) the default values for several of the filters and dropdowns used in the Wayop application.","sidebar":"defaultSidebar"},"tours":{"id":"tours","title":"Tours","description":"The tours tab allows you to see your tour departures and the bookings associated with each of you tours. The tour view is updated automatically every time a new booking is created or modified in B\xf3kun. Wayop connects to B\xf3kun using APIs and webhooks to always ensure that the data you see is up to date. Tours are sorted by departure date, the earliest departure being at the top of each tour! The tours page allows you to assign resources (guides, equipment, vehicles etc.) in order to automate your daily tour operations.","sidebar":"defaultSidebar"},"users":{"id":"users","title":"Users","description":"The users page is where you can create new users and give granular access to your team. You can define which page each user can access and even link a user to a resource. For example, a guide could be limited to only see the tours assigned to him.","sidebar":"defaultSidebar"}}}')}}]);